import { Container, Row, Col } from 'react-bootstrap';

function App() {
  return (
    <div>
      <Container>
        <Row>
          <Col xs={12} md={8}>1</Col>
          <Col>1</Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
